import React from 'react'
import "./Home.css"
import img1 from '../assets/image/img1.jpg';

const useStyle = makeStyle({
  image:{
    width:"100%",
    height:"50%",
  },
  component:{
    margin: 50
}
})
const Home =() => {
  const classes =useStyle();
    return (
      <Box className={classes.component}>
         <Box style ={{display:'flex'}}>
           <img className={classes.image} src={img1}/>
           </Box>
           </Box>
      
  
  )
}
export default Home;
